import React from "react";
import "./Header.scss"

export default function Header({ title, caption }) {
    return (
        <div id="header-container" class="header align-self-center text-center">
            <h1 id="header-title">{title}</h1>
            <p id="header-caption">{caption}</p>
        </div>
    )
}
